import React from "react";

import {
  Drawer,
  Input,
  InputNumber,
  Select,
  Button,
  Form,
  Row,
  Col
} from "antd";

const ReservationDrawer = ({ visible, onClose, username, onNameChange }) => {
  return (
    <Drawer
      title="Reservation"
      width={420}
      closable={false}
      visible={visible}
      onClose={onClose}
    >
      <Form>
        <Form.Item label="Enter customer name">
          <Input
            placeholder="Enter name"
            value={username}
            onChange={onNameChange}
          />
        </Form.Item>
        <Form.Item label="Enter Table Number">
          <InputNumber placeholder="Enter name" value={username} />
        </Form.Item>
      </Form>
    </Drawer>
  );
};

export default ReservationDrawer;
